import React from 'react'

export default function GameItem({game}) {
    return (
        <div class="box" data-game={game.name} data-tags={game.tags}>
            <a href={game.url}>
                <img class="game-img" src={game.image} alt={game.name} />
            </a>
        </div>
    )
}
